create table artikelstammdaten
(
    id               int auto_increment
        primary key,
    artikelnummer    varchar(255)                         not null,
    typ              varchar(255)                         null,
    bezeichnung      varchar(255) collate utf8_unicode_ci not null,
    spezifikation    varchar(255)                         not null,
    erwSpezifikation varchar(500) collate utf8_unicode_ci null,
    hersteller       varchar(255)                         not null,
    bestand          float                                null,
    warengruppe      int                                  null,
    constraint artikelstammdaten_fk
        foreign key (warengruppe) references productgroup (id)
);

